import React, {Component} from 'react';

export default class Find extends Component {
	render() {
		return (
			<div> 
				<h2> Do you want to share your experience?</h2>
				<p> PlaceHolder is a open platform, created with the reviews from anyone who is willing to rate and share his experience.</p>
				<p> Our objective is to help you find to find the opinion from other users that will help you to make the right decision </p>
				<p> Do you want to contribute? </p>
				<button> Add a review </button> 
			</div>
			);
	}
}
